CREATE TABLE users_customuser (
    id SERIAL PRIMARY KEY,
    password VARCHAR(128) NOT NULL,
    last_login TIMESTAMP WITH TIME ZONE NULL,
    is_superuser BOOLEAN NOT NULL,
    username VARCHAR(150) NOT NULL UNIQUE,
    first_name VARCHAR(150) NOT NULL,
    last_name VARCHAR(150) NOT NULL,
    email VARCHAR(254) NOT NULL,
    is_staff BOOLEAN NOT NULL,
    is_active BOOLEAN NOT NULL,
    date_joined TIMESTAMP WITH TIME ZONE NOT NULL,
    profile_picture VARCHAR(100) NULL,
    phone_number VARCHAR(20) NULL,
    bio TEXT NOT NULL,
    fullname VARCHAR(50) NOT NULL 
);

ALTER TABLE users_customuser
ADD COLUMN team_id BIGINT NULL UNIQUE;

CREATE TABLE django_migrations (
    id SERIAL PRIMARY KEY,
    app VARCHAR(255) NOT NULL,
    name VARCHAR(255) NOT NULL,
    applied TIMESTAMP WITH TIME ZONE NOT NULL
);
CREATE TABLE django_content_type (
    id SERIAL PRIMARY KEY,
    app_label VARCHAR(100) NOT NULL,
    model VARCHAR(100) NOT NULL
);
CREATE TABLE auth_group (
    id SERIAL PRIMARY KEY,
    name VARCHAR(150) NOT NULL UNIQUE
);
CREATE TABLE auth_permission (
    id SERIAL PRIMARY KEY,
    content_type_id INTEGER NOT NULL REFERENCES django_content_type (id),
    codename VARCHAR(100) NOT NULL,
    name VARCHAR(255) NOT NULL
);
CREATE TABLE auth_group_permissions (
    id SERIAL PRIMARY KEY,
    group_id INTEGER NOT NULL REFERENCES auth_group (id),
    permission_id INTEGER NOT NULL REFERENCES auth_permission (id)
);
CREATE TABLE teams_division (
    id SERIAL PRIMARY KEY,
    name VARCHAR(255) NOT NULL UNIQUE,
    num_weeks INTEGER NOT NULL,
    start_date DATE NOT NULL
);
CREATE TABLE teams_team (
    id SERIAL PRIMARY KEY,
    name VARCHAR(255) NOT NULL UNIQUE,
    captain_id BIGINT NOT NULL REFERENCES users_customuser (id),
    division_id BIGINT NULL REFERENCES teams_division (id),
    team_image VARCHAR(100) NULL,
    bio TEXT NOT NULL,
    location VARCHAR(255) NOT NULL
);
CREATE TABLE teams_team_members (
    id SERIAL PRIMARY KEY,
    team_id BIGINT NOT NULL REFERENCES teams_team (id),
    customuser_id BIGINT NOT NULL REFERENCES users_customuser (id)
);
CREATE TABLE users_customuser_groups (
    id SERIAL PRIMARY KEY,
    customuser_id BIGINT NOT NULL REFERENCES users_customuser (id),
    group_id INTEGER NOT NULL REFERENCES auth_group (id)
);
CREATE TABLE users_customuser_user_permissions (
    id SERIAL PRIMARY KEY,
    customuser_id BIGINT NOT NULL REFERENCES users_customuser (id),
    permission_id INTEGER NOT NULL REFERENCES auth_permission (id)
);
CREATE TABLE django_admin_log (
    id SERIAL PRIMARY KEY,
    object_id TEXT NULL,
    object_repr VARCHAR(200) NOT NULL,
    action_flag SMALLINT NOT NULL,
    change_message TEXT NOT NULL,
    content_type_id INTEGER NULL REFERENCES django_content_type (id),
    user_id BIGINT NOT NULL REFERENCES users_customuser (id),
    action_time TIMESTAMP WITH TIME ZONE NOT NULL
);
CREATE TABLE django_session (
    session_key VARCHAR(40) NOT NULL PRIMARY KEY,
    session_data TEXT NOT NULL,
    expire_date TIMESTAMP WITH TIME ZONE NOT NULL
);
CREATE TABLE users_profile (
    id SERIAL PRIMARY KEY,
    phone_number VARCHAR(20) NULL,
    bio TEXT NOT NULL,
    user_id BIGINT NOT NULL UNIQUE REFERENCES users_customuser (id),
    fullname VARCHAR(50) NOT NULL,
    profile_picture VARCHAR(100) NULL
);
CREATE TABLE fixtures_fixture (
    id SERIAL PRIMARY KEY,
    date DATE NOT NULL,
    away_team VARCHAR(255) NULL,
    division_id BIGINT NOT NULL REFERENCES teams_division (id),
    bye_team_id BIGINT NULL REFERENCES teams_team (id),
    home_team VARCHAR(255) NULL
);
CREATE TABLE scores_match (
    id SERIAL PRIMARY KEY,
    away_score INTEGER NOT NULL,
    date DATE NOT NULL,
    away_team_id BIGINT NOT NULL REFERENCES teams_team (id),
    division_id BIGINT NULL REFERENCES teams_division (id),
    home_team_id BIGINT NOT NULL REFERENCES teams_team (id),
    home_score INTEGER NOT NULL
);
CREATE TABLE scores_individualscore (
    id SERIAL PRIMARY KEY,
    home_or_away_win VARCHAR(5) NOT NULL,
    away_player_id BIGINT NULL REFERENCES users_customuser (id),
    home_player_id BIGINT NULL REFERENCES users_customuser (id),
    match_id BIGINT NOT NULL REFERENCES scores_match (id)
);
CREATE TABLE tournaments_tournament (
    id SERIAL PRIMARY KEY,
    name VARCHAR(255) NOT NULL UNIQUE,
    start_date DATE NULL,
    description TEXT NOT NULL,
    winner_id BIGINT NULL REFERENCES users_customuser (id)
);
CREATE TABLE tournaments_finalmatch (
    id SERIAL PRIMARY KEY,
    score1 INTEGER NULL,
    score2 INTEGER NULL,
    player1_id BIGINT NULL REFERENCES users_customuser (id),
    player2_id BIGINT NULL REFERENCES users_customuser (id),
    tournament_id BIGINT NOT NULL REFERENCES tournaments_tournament (id),
    winner_id BIGINT NULL REFERENCES users_customuser (id)
);
CREATE TABLE tournaments_last16match (
    id SERIAL PRIMARY KEY,
    score1 INTEGER NULL,
    score2 INTEGER NULL,
    player1_id BIGINT NULL REFERENCES users_customuser (id),
    player2_id BIGINT NULL REFERENCES users_customuser (id),
    tournament_id BIGINT NOT NULL REFERENCES tournaments_tournament (id),
    winner_id BIGINT NULL REFERENCES users_customuser (id)
);
CREATE TABLE tournaments_last32match (
    id SERIAL PRIMARY KEY,
    score1 INTEGER NULL,
    score2 INTEGER NULL,
    player1_id BIGINT NULL REFERENCES users_customuser (id),
    player2_id BIGINT NULL REFERENCES users_customuser (id),
    tournament_id BIGINT NOT NULL REFERENCES tournaments_tournament (id),
    winner_id BIGINT NULL REFERENCES users_customuser (id)
);
CREATE TABLE tournaments_quarterfinalmatch (
    id SERIAL PRIMARY KEY,
    score1 INTEGER NULL,
    score2 INTEGER NULL,
    player1_id BIGINT NULL REFERENCES users_customuser (id),
    player2_id BIGINT NULL REFERENCES users_customuser (id),
    tournament_id BIGINT NOT NULL REFERENCES tournaments_tournament (id),
    winner_id BIGINT NULL REFERENCES users_customuser (id)
);
CREATE TABLE tournaments_semifinalmatch (
    id SERIAL PRIMARY KEY,
    score1 INTEGER NULL,
    score2 INTEGER NULL,
    player1_id BIGINT NULL REFERENCES users_customuser (id),
    player2_id BIGINT NULL REFERENCES users_customuser (id),
    tournament_id BIGINT NOT NULL REFERENCES tournaments_tournament (id),
    winner_id BIGINT NULL REFERENCES users_customuser (id)
);



